		var f_TF = new createjs.Text();
		this.back.visible = false;
		
		function spotTheDiff()
		{
			
			this.visible = false;
			
			if(this.parent.children){
				this.parent.removeChild(f_TF);
			}
			
			count++;
			
			var f_TextToDisplay = "Difference spotted: " + count;
			
			f_TF.x = 320;
			f_TF.y = 460;
			f_TF.color = "#000";
			f_TF.font = "20px Bree Semibold";
			f_TF.text = f_TextToDisplay;
			this.parent.addChild(f_TF);
			
			if(count == 6){
				this.parent.back.visible = true;
			}
			
		}
		
		//go back
		this.back.addEventListener("click", fl_ClickToGoToAndStopAtFrame.bind(this));
